@pytest.mark.slow
class TestFilscoutFilecoinApiCalls(TestCase):
    api = FilecoinFilscoutApi
    addresses_of_account = ['f410f6vyzxlrug5vux6x5a7pvdl2orafibezzpbywv6y',
                            'f1emm55jaulyucsuttc7a6cf62uysn5rcwd7k4qyy',
                            'f3wrzbnrhrltyqb5osk74bqu5kh4xl4nultxyre2dlsef2xtxul6krfhawx4tq2cb6y6me26cqznaenutlvzna']
    hash_of_transactions = ['bafy2bzacedjn33wphjyplalpldglnsdobuh2thbgovwtpwkrwjcut6u454mms',
                            'bafy2bzacecfxhra72l2nievebqxwbmrroldhu7fldep2yfe7x2qgcdwtegux4']
    # height 3085955
    block_hashes = ['bafy2bzacedtwqndikvo3klgzs6gq3evsql5qt7d7g6dbiamecq2btcybls63w',
                    'bafy2bzacebrtkr5pwasrd2cjqifaympzncplw47l2h5etkq2taksisfeivv5w',
                    'bafy2bzacebuqhd7ptk7svjbc32fpy3e3xy2nclla7kygwqagcvo43jx2sknau']

    @classmethod
    def check_general_response(cls, response, keys):
        if set(response.keys()).issubset(keys):
            return True
        return False

    def test_get_balance_api(self):
        first_layer_keys = {'code', 'data', 'message'}
        keys = {'idAddress', 'addressFnsName', 'robustAddress', 'actorType', 'createTime', 'lastTransactionTime',
                'balance', 'miners', 'tag', 'msgCount', 'ethAddress', 'workerMiners',
                'contractVerified', 'address', 'favorAccount', 'favorStatus', 'benefitedMiners', 'multiDetail'}
        for address in self.addresses_of_account:
            get_balance_result = self.api.get_balance(address)
            assert self.check_general_response(get_balance_result, first_layer_keys)
            assert self.check_general_response(get_balance_result.get('data').get('actor'), keys)
            assert isinstance(get_balance_result, dict)
            assert isinstance(get_balance_result.get('data').get('actor').get('balance'), str)

    def test_get_address_txs_api(self):

        address_keys = {'code', 'total', 'pageIndex', 'pageSize', 'data', 'Message'}
        transaction_keys = {'cid', 'height', 'time', 'timeFormat', 'fee', 'fromFnsName', 'toFnsName', 'from', 'to',
                            'toType', 'value', 'method', 'exitCodeName'}
        for address in self.addresses_of_account:
            get_address_txs_response = self.api.get_address_txs(address)
            assert self.check_general_response(get_address_txs_response, address_keys)
            assert len(get_address_txs_response) > 0
            for transaction in get_address_txs_response.get('data'):
                assert self.check_general_response(transaction, transaction_keys)

    def test_get_block_head_api(self):
        first_layer_keys = {'code', 'data', 'message'}
        blockhead_keys = {'height_blocks', 'minerBlockRate', 'maxBlockCount'}
        each_block_keys = {'height', 'height_time', 'blocks'}
        get_block_head_response = self.api.get_block_head()
        assert self.check_general_response(get_block_head_response, first_layer_keys)
        assert self.check_general_response(get_block_head_response.get('data'), blockhead_keys)
        for height_block in get_block_head_response.get('data').get('height_blocks'):
            assert self.check_general_response(height_block, each_block_keys)
            assert type(height_block.get('height')) == int
            assert type(height_block.get('height_time')) == str
            assert type(height_block.get('blocks')) == list

    def test_get_tx_details_api(self):
        first_layer_keys = {'code', 'data', 'message'}
        transaction_keys = {'cid', 'height',
                            'blockCid', 'time',
                            'from',
                            'fromFnsName', 'fromTag', 'fromIsVerified',
                            'to',
                            'toFnsName', 'toTag', 'toIsVerified', 'value', 'raw_value',
                            'atto_value', 'method', 'exitCodeName', 'version',
                            'nonce', 'gasUsed', 'gasLimit', 'gasPremium',
                            'gasFeeCap', 'totalBurnFee',
                            'burnFee', 'overBurnFee',
                            'minerTip', 'paramsRes', 'ethLogsRes', 'fee',
                            'toType', 'toActorType', 'receipt', 'errorInfoSynced',
                            'errorInfo',
                            'return', 'signature'}
        for tx_hash in self.hash_of_transactions:
            get_tx_details_response = self.api.get_tx_details(tx_hash)
            assert self.check_general_response(get_tx_details_response, first_layer_keys)
            assert self.check_general_response(get_tx_details_response.get('data'), transaction_keys)

    def test_get_block_txs_api(self):
        first_layer_keys = {'code', 'total', 'pageIndex', 'pageSize', 'data', 'Message'}
        block_keys = {'cid', 'height', 'time', 'timeFormat', 'fee', 'fromFnsName', 'toFnsName', 'from', 'to',
                      'toType', 'value', 'method', 'exitCodeName'}
        for block_hash in self.block_hashes:
            get_block_txs_response = self.api.get_block_txs(block_hash)
            assert len(get_block_txs_response) != 0
            assert self.check_general_response(get_block_txs_response[0], first_layer_keys)
            if get_block_txs_response[0].get('data'):
                for transaction in get_block_txs_response[0].get('data'):
                    assert self.check_general_response(transaction, block_keys)


